DROP PROCEDURE IF EXISTS `CleanOldHistory`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `CleanOldHistory` (IN `days_to_keep` INT)   BEGIN
    DECLARE deleted_rows INT DEFAULT 0;
    
    -- Nettoyer l'historique des articles
    DELETE FROM articles_history 
    WHERE changed_at < DATE_SUB(NOW(), INTERVAL days_to_keep DAY);
    SET deleted_rows = ROW_COUNT();
    
    -- Nettoyer les logs anciens
    DELETE FROM sync_logs 
    WHERE sync_date < DATE_SUB(NOW(), INTERVAL days_to_keep DAY);
    
    SELECT CONCAT('Nettoyage terminé: ', deleted_rows, ' enregistrements supprimés de l\'historique') as result;
END$$

--
-- Functions
