DROP FUNCTION IF EXISTS `CompareArticleVersions`$$
CREATE DEFINER=`root`@`localhost` FUNCTION `CompareArticleVersions` (`old_json` JSON, `new_json` JSON) RETURNS TEXT CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci DETERMINISTIC READS SQL DATA BEGIN
    DECLARE changes TEXT DEFAULT '';
    
    -- Comparaison des champs principaux
    IF JSON_UNQUOTE(JSON_EXTRACT(old_json, '$.DisplayProductNumber')) != JSON_UNQUOTE(JSON_EXTRACT(new_json, '$.DisplayProductNumber')) THEN
        SET changes = CONCAT(changes, 'DisplayProductNumber modifié; ');
    END IF;
    
    IF JSON_EXTRACT(old_json, '$.BRGrossWeight') != JSON_EXTRACT(new_json, '$.BRGrossWeight') THEN
        SET changes = CONCAT(changes, 'BRGrossWeight modifié; ');
    END IF;
    
    IF JSON_UNQUOTE(JSON_EXTRACT(old_json, '$.Category')) != JSON_UNQUOTE(JSON_EXTRACT(new_json, '$.Category')) THEN
        SET changes = CONCAT(changes, 'Category modifiée; ');
    END IF;
    
    -- Ajouter d'autres comparaisons selon les besoins
    
    IF changes = '' THEN
        SET changes = 'Modifications mineures détectées';
    END IF;
    
    RETURN TRIM(TRAILING '; ' FROM changes);
END$$

